import React, {Component} from 'react';
import {Input, Label} from 'reactstrap'
import RatingStar from 'react-rating';

class Estrellas extends Component {
  constructor() {
    super();

    this.state = {
      rating: 1
    };
    this.onStarClick= this.onStarClick.bind(this);
  }

  onStarClick(value) {
    this.setState({rating: value});
    console.log(this.state.rating)
  }

  render() {

    return (
      <div> 
          <p className="calificacion">
      <Input onClick={this.onStarClick('5')} id="radio1" type="radio" name="estrellas" value="5" checked={''}/>
      <Label for="radio1">★</Label>
      <Input onClick={this.onStarClick('4')} id="radio2" type="radio" name="estrellas" value="4" checked={''}/>
      <Label for="radio2">★</Label>
      <Input onClick={this.onStarClick('3')} id="radio3" type="radio" name="estrellas" value="3" checked={''}/>
      <Label for="radio3">★</Label>
      <Input onClick={this.onStarClick('2')} id="radio4" type="radio" name="estrellas" value="2" checked={''}/>
      <Label for="radio4">★</Label>
      <Input onClick={this.onStarClick('1')} id="radio5" type="radio" name="estrellas" value="1" checked={''}/>
      <Label for="radio5">★</Label>
      </p>
      </div>
    );
  }
}
export default Estrellas;
